(30, 'Terms & Conditions', 'terms-conditions', '<h2><span style=\"font-size:16pt\"><span style=\"color:#434343\">TERMS OF SERVICE</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Please carefully read the following Terms of Use before using the hautesignatures.com Website (the &ldquo;Site&rdquo;). By accessing this Site, you agree to be bound by these Terms of Use. These Terms of Use may be updated from time to time. Accordingly, you should check the date of the Terms of Use (which appear at the end of this document) and review any changes since the last version. If at any time you do not agree to these Terms of Use, please do not use this Site.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This Web site is operated by HAUTE GLOBAL COMPANY (&ldquo;Haute Signatures&rdquo;). Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to Haute Signatures.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Haute Signatures offers this Website, including all information, tools and services available from this site, to you, the user, conditioned upon your acceptance of all the terms, conditions, policies and notices stated here. Your continued use of this site constitutes your agreement to these Terms of Use.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Accuracy, Completeness and Timeliness of Information on This Site</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or timelier sources of information. Any reliance on the material on this site is at your own risk. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on the site. You agree that it is your responsibility to monitor changes to the site.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Orders, Prohibition on Reselling, and Price</span></span></h2>\r\n\r\n<h2><span style=\"font-size:10pt\"><span style=\"color:#434343\">The information on this site does not constitute a binding offer to sell products described on the site or to make such products available in your area. We reserve the right at any time after receipt of your order to accept or decline your order, or any portion thereof, in our sole discretion, even after your receipt of an order confirmation or after your credit card has been charged. You may not purchase any item from this site for resale by you or any other person, and you may not resell any item purchased from this site. In the event a product is listed at an incorrect price, we have the right to refuse or cancel orders placed for the product listed at the incorrect price, regardless of whether the order has been confirmed or your credit card charged. If your credit card has already been charged for the purchase and your order is cancelled, we will issue a credit to your credit card account.</span></span></h2>\r\n\r\n<h3><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Product Information</span></span></h3>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Select products can be found in some stores in Nigeria while supplies last. In some cases, products displayed for sale on the site may not be available in stores. The particular technical specifications and settings of your computer and its display could affect the accuracy of its display of the colours of products offered on the site</span></span></p>\r\n\r\n<h3><span style=\"f