ement and understanding between you and Haute Signatures with respect to the subject matter thereof and supersede all prior or contemporaneous communications and proposals, whether oral or written, between the parties with respect to such subject matter. A printed version of these Terms of Use shall be admissible in judicial or administrative proceedings based on or relating to use of the site to the same extent and subject to the same conditions as other business documents and records originally generated and maintained in printed form.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Sever-ability</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If any provision of this agreement is unlawful, void or unenforceable, the remaining provisions of the agreement will remain in place.</span></span></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2><span style=\"font-size:16pt\"><span style=\"color:#434343\">PRIVACY</span></span></h2>\r\n\r\n<h3><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">What information do we collect?</span></span></h3>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We collect information from you when you register on our site or subscribe to our newsletter.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Google, as a third party vendor, uses cookies to serve ads on your site. Google&rsquo;s use of the DART cookie enables it to serve ads to your users based on their visit to your sites and other sites on the Internet. Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy.</span></span></p>\r\n\r\n<h3><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">What do we use your information for?</span></span></h3>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Any of the information we collect from you may be used in one of the following ways:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To personalize your experience</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">(your information helps us to better respond to your individual needs)</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To improve our website</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">(we continually strive to improve our website offerings based on the information and feedback we receive from you)</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To improve customer service</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">(your information helps us to more effectively respond to your customer service requests and support needs)</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To process transactions</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To administer a contest, promotion, survey or other site feature</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To send periodic emails</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">The email address you provide for order processing, will only be used to send you information and updates pertaining to your order.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Note: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">How do we protect your information?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems and are required to keep the information confidential.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Do we use cookies?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes (Cookies are small files that a site or its service provider transfers to your computer&rsquo;s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We use cookies to help us remember and process the items in your shopping cart and understand and save your preferences for future visits.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Do we disclose any information to outside parties?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or other rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Online Privacy Policy Only</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This online privacy policy applies only to information collected through our website and not to information collected offline.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Your Consent</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">By using our site, you consent to our web site privacy policy.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Changes to our Privacy Policy</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If we decide to change our privacy policy, we will post those changes on this page.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Contacting us</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you have any questions or comments about these Terms of Use or this site, please contact us by email: info@hautesignatures.com</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This site is owned and operated by</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Haute Signatures.</span></span></p>', '2020-05-03 15:05:55', '2020-11-23 23:21:20', 10, 1, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
(47, 'Coffe tea', 'coffe-tea', '<p>Coffe tea</p>', '2020-05-16 23:11:03', '2020-05-16 23:11:03', 15, 8, 'http://ohramhealth.test/products/coffe', 0, NULL, NULL, 0, 'https://www.ohram.org/images/banners/sBjTuo6PdNLwm1TFERb5w1tTN0LbgqtEp3HhlBwM.png', '50', '50', NULL),
(65, 'FAQ', 'faq', '<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">1. Why Can&rsquo;t I Sign Into my Account?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you&rsquo;re having trouble signing in, please check you&rsquo;re using the same email address and password you used to register with us. Our passwords are case sensitive, so check you haven&rsquo;t accidentally left Caps Lock on. If you forget your password, you can reset it, by clicking on the forgotten password link on the login page. An e-mail containing a link to create a new password will be sent to the email address with which you registered. Please check your junk mail folder in case it makes its way there.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">2. Do I Need to Create a Haute Signatures Account?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">You can browse our website and add items to your basket without creating an account, but to make any purchases you need to create an account by providing an email address and creating a password. Once you&rsquo;ve created an account, shopping with us will be so much more FUN.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">3. How Do I Return An Item?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&nbsp;Kindly notify customer service within 48 hours of shipment delivery. We will arrange a pick-up at your convenience within 72 hours after you indicate a return request. Please note that charges may apply and Haute Signatures reserves the right to refuse returns. For more information &nbsp;<a href=\"https://hautesignatures.com/pages/shipping-delivery\" target=\"_self\">Click Here</a>&nbsp;or contact us on +234(0)8092907541</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">4. What Should I Do If My Order Isn&rsquo;t Delivered?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If your order has not been delivered within the timescales for your area, please contact us. Remember to include your order number within your message as this will help us speed up the search for your order.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">In the unlikely event that we&rsquo;re unable to locate your parcel, we will send you a &lsquo;Missing Parcel Claim Form&rsquo; to sign and return, which will act as a declaration of your claim. Upon receipt of your declaration, we will investigate the claim and advise you of the outcome within 4 working days. If appropriate, a refund will be issued to the credit/debit card used for your purchase AS SOON AS POSSIBLE.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">5. Delivery Times And Charges</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Delivery timeframe is between&nbsp;1-5 working days depending on your location. For more information <a href=\"https://hautesignatures.com/pages/shipping-delivery\">click here</a><a href=\"//wa.link/xqn5fy\">&nbsp;</a>or contact us on +234(0)8092907541</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">6. Do You Deliver To Offices?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes, you can have your orders delivered to a home or work address that is convenient for you.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">You can also enter delivery instructions when you&rsquo;re placing your order e.g. &ldquo;leave with receptionist Teju&rdquo;.&nbsp;</span></span><span style=\"font-size:10pt\"><span style=\"color:#434343\">However Haute Signatures is not liable for any parcels that are lost or stolen if specific delivery instructions are left for the carrier.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">7. How Can I Pay on Your Site?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We accept major debit cards on our platform, our CBN approved payment portal is totally secure with data encryption, SSL certificates, 24/7 monitoring and other myriad methods to keep you totally covered. We ask your bank for authorization of your debit/credit card when you place an order with us. You can also pay via bank transfer, send receipt of your payment to our WhatsApp number +2348092907541.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Your order will be shipped as soon as we receive the funds.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">8. Do You Ship Internationally?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">NO, we don&rsquo;t ship internationally for now.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">9. Will I Receive Confirmation That My Order is Successful and on It&rsquo;s Way To Me?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&nbsp;Once you have successfully submitted your order, you will receive an automated email confirming your order details. Your order will then be processed by our warehouse team and you&rsquo;ll receive a dispatch confirmation email when your order is dispatched for delivery.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">10. My Order Has Been Confirmed But I Received An Email/Phone call Saying One Of The Items Is Out Of Stock, Why Has This Happened?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Unfortunately, although our systems showed available stock when your order was placed, when we checked our warehouse, we found that the product was not available. Therefore, we will be unable to send this item to you, if payment has been made; your money will be refunded immediately.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">11. Can I Cancel/Change My Order After It Has Been Confirmed?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may be able to cancel or change your order, but we can only do this by telephone. You need to call us as soon as possible, after you have placed your order otherwise it may be too late.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Please call us on our hotline +234(0)8092907541.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Please note &ndash; If you do not contact us in time, your order will be dispatched and you will have to pay a return fee.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">12. How Do You Get Your Products To Be So Affordable?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We understand that your wardrobe, home and wallet are personal, therefore, to bring you affordable products that are still bang on trend, we eliminate the middleman as much as we can and bring you products straight from the manufacturer.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">13. If An Item Is Sold Out, Can I Request That It Be Restocked?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes, you can request for an item that is sold out on our site to be restocked by filling the contact us form but we cannot guarantee its availability as we have to verify from our manufacturers and suppliers. We assure you that we are working tirelessly to meet all your shopping needs and will keep you informed on the products&rsquo; availability.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">14. How Do I Order Wholesale?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\"><span style=\"background-color:#ffffff\">If you would like to become an official Haute Signatures stockist/wholesaler, please send an email to haute.signatures@gmail.com&nbsp;or whatsapp </span>+234(0)8092907541 <a href=\"//wa.link/xqn5fy\">Whatsapp Link</a></span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">15. What are your business hours?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We operate 9am to 6pm Monday through Friday and Saturday 10am to 4pm. We are closed on Saturday and Public holidays but you can place your orders via our website.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">16. I am not available for delivery or pick up now, can I stockpile?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes Babe, you can. Stockpiling is free for a month after which we&rsquo;ll charge 500 for every extra week your item remains with us.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">17. Can I change my delivery address after my order has been shipped?</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes you can, but we suggest that the parcel is dropped off for a 3rd party (e.g your neighbor or security personnel) if you will be going back to that address. If you will not like this option, we can change it to your new address. Please note that charges may apply if delivery is not&nbsp; within the same axis as we might have to recall and readdress your parcel to your new location.</span></span></p>', '2020-11-23 22:43:41', '2020-12-17 03:24:30', 9, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL);
